import { useContext } from "react";
import { ProductsContext } from "../../contexts/ProductsContext";

function Products() {
  const { products } = useContext(ProductsContext);
  return (
    <div>
      Products
      {products.map((product) => product.name)}
    </div>
  );
}

export default Products;
